import '../C_dashboard/style_resource.css';

function Resource(props) {
  return (    
    <div class="reso">
      <div class="reso_details">
        <div class="reso_heading">
          <div class="reso_detail1">{props.author} </div>        
          <div class="reso_detail2">
            | 3rd year pursing {props.degree} at {props.school}</div>                 
        </div>                                
        <div class="reso_subheading">
          <div class="reso_detail2"> shares {props.course} {props.type}</div>          
        </div>        

        <div class="reso_detail1">{props.about}</div>

      </div>     
    </div>  
  );
}

export default Resource;
